import React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import { useNavigate } from "react-router-dom";
import IconButton from '@mui/material/IconButton';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';
import classes from '../Login.module.css';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import InputAdornment from '@mui/material/InputAdornment';
// import DatePicker from '../DatePicker';
import AdapterDateFns from '@mui/lab/AdapterDateFns';
import LocalizationProvider from '@mui/lab/LocalizationProvider';
import DatePicker from '@mui/lab/DatePicker';
const TaskForm = props => {
    const navigate = useNavigate()

    const goBackHandler = () => {
        navigate("/Account")
    }

    // const [date, setDate] = React.useState('Controlled');

    // const dateChange = (event) => {
    //     setValue(event.target.value);
    // };

    const [value, setValue] = React.useState(null);
    return (
        <Container align="center">
            <Card variant="outlined" sx={{ maxWidth: 500, maxHeight: 8000, borderRadius: 5, borderColor: 'primary.main', paddingTop: 1, m: 1 }} margin="10px">
                <CardActions>
                    <IconButton sx={{ marginLeft: 1, }} onClick={goBackHandler}>
                        <ChevronLeftIcon />
                    </IconButton>
                </CardActions>
                <CardContent>
                    <Typography variant="h4" component='div' fontSize='26px' className={classes.registration}>Add Task</Typography>
                    <Box
                        component="form"
                        sx={{
                            marginTop: 5,
                            marginLeft: 0,
                            '& .MuiTextField-root': { m: 1, width: '40ch', size: 'small' },
                        }}
                        noValidate
                        autoComplete="off"  >
                        <div>
                            <TextField
                                required
                                multiline
                                size='medium'
                                id="username"
                                label="UserName"
                                placeholder="xyz_abc123"
                            />
                            <TextField
                                multiline
                                size='medium'
                                id="roll-id-agency"
                                label="Roll"
                                defaultValue="Agency"
                            />
                            <TextField
                                required
                                multiline
                                size='medium'
                                id="description-task"
                                label="Description"
                                placeholder="xyzbfhfkabc"
                            />
                            {/* <TextField
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <LocalizationProvider dateAdapter={AdapterDateFns}>
                                                <DatePicker
                                                    disableFuture
                                                    label="Date"
                                                    openTo="year"
                                                    views={['year', 'month', 'day']}
                                                    value={value}
                                                    onChange={
                                                        (newValue) => { setValue(newValue); }
                                                    }
                                                    renderInput={(params) => <TextField {...params} />}
                                                />
                                            </LocalizationProvider>
                                        </InputAdornment>
                                    ),
                                }}
                                variant="outlined">
                            </TextField> */}
                            <TextField
                                disableFuture
                                variant="outlined"
                                color="primary"
                                inputProps={{
                                    type: "date",
                                    accept: "date"
                                }}

                                label="Date" />

                            {/* <LocalizationProvider dateAdapter={AdapterDateFns}>
                                <DatePicker
                                    disableFuture
                                    label="Date"
                                    openTo="year"
                                    views={['year', 'month', 'day']}
                                    value={value}
                                    onChange={
                                        (newValue) => { setValue(newValue); }
                                    }
                                    renderInput={(params) => <TextField {...params} />}
                                />
                            </LocalizationProvider> */}
                            <TextField
                                labelId="demo-simple-select-label"
                                id="select-roll"
                                label="Roll"
                                InputProps={{
                                    type: "select",
                                    textAlign: 'left' ,
                                    labelId:"demo-simple-select-label",
                                    id:"select-roll",
                                    label:"Roll",
                                    value:{roll},
                                    onChange:{rollChangeHandler}
                                }}>


                            </TextField>
                            <div className={classes.button}>
                                <Button
                                    variant="contained"
                                    onClick={props.onClick}
                                    sx={{
                                        marginTop: 0.5,
                                        marginRight: -34,
                                    }}>
                                    Submit</Button>
                            </div>
                        </div>
                    </Box>
                </CardContent>
            </Card>
        </Container>
    );

};
export default TaskForm;
